import React from "react";
import ReactDOMClient from "react-dom/client";
import "./css/main.css";

class Program extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <h1
          onMouseEnter={() => {
            console.log("Mouse enter");
          }}
          onMouseLeave={() => {
            console.log("Mouse leave");
          }}
        >
          Text header
        </h1>
      </div>
    );
  }
}
export default Program;

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Program />);
